Axe Cop Series

Axe Cop Volume 1

Bad guys beware! Evil aliens, run for your lives! Axe Cop is here, and he's going to chop your head off! We live in a strange world, and our strange problems call for strange heroes. That's why Axe Cop ? along with his partner Flute Cop and their pet T-Rex Wexter ? is holding try-outs to build the greatest team of heroes ever assembled. Created by five year-old Malachai Nicolle and illustrated by his older brother, the cartoonist Ethan Nicolle, Axe Cop Volume One collects the entire original run of the hit webcomic that has captured the world's attention with its.....


